(7, 36, 'Christmas Boxes - Custom CMYK Boxes', 'Make this Christmas extra special with personalized custom Christmas boxes. Whether you have gifts to present or a wide range of products customize your boxes in your style and spread happiness.', '2023-05-02 15:41:32', '2023-05-02 15:41:32'),
(9, 38, 'Cigarette Boxes - Custom CMYK Boxes', 'Give your customers a reason to select your cigarette by packing them in head turning custom cigarette boxes', '2023-05-02 15:47:12', '2023-05-02 15:47:12'),
(10, 39, 'Apparel Boxes - Custom CMYK Boxes', 'Packaging can make or break your brand so ensure excellence in your packaging. Design your exclusive packaging yourself and reign the market with the most exquisite custom apparel boxes.', '2023-05-02 15:59:34', '2023-05-02 15:59:34'),
(11, 40, 'Presentation Boxes - Custom CMYK Boxes', 'Custom presentation boxes are the most strategical, highly effective and head-turning marketing solution. These boxes do all the functions of packing, presenting and promoting your brand and product.', '2023-05-02 16:07:27', '2023-05-02 16:07:27'),
(12, 41, 'Rigid Boxes - Custom CMYK Boxes', 'Custom rigid boxes being the epitome of luxury and class are the best solution to pack your luxury and expensive products in style.', '2023-05-02 16:10:34', '2023-05-02 16:10:34'),
(13, 42, 'Sleeve Boxes - Custom CMYK Boxes', 'Extremely versatile, custom sleeve boxes are perfect to pack any product. They are heavy duty and are designed to last. Their unique design is highly functional and a top priority of leading brands.', '2023-05-02 16:16:07', '2023-05-02 16:16:07'),
(15, 44, 'Auto Lock Boxes - Custom CMYK Boxes', 'Extraordinary products calls for extraordinary packaging. If you think your product is extraordinary so then bring it into customer\'s notice by packing it in extraordinary custom auto lock boxes', '2023-05-02 16:24:38', '2023-05-02 16:24:38'),
(16, 45, 'Beard Oil Boxes - Custom CMYK Boxes', 'Are you looking to take your brand to the next level? Custom beard boxes are exactly what your brand needs for overnight success. ', '2023-05-02 16:49:13', '2023-05-02 16:49:13'),
(17, 46, 'Cream Boxes - Custom CMYK Boxes', 'Custom Cream Boxes offer your creams everything that they need to withstand the rigorous market competition. ', '2023-05-02 16:50:25', '2023-05-02 16:50:25'),
(18, 47, 'Business Card Boxes - Custom CMYK Boxes', 'Want to manage your business cards while adding a touch of elegance to your office? Custom Business Card Boxes are not only fully customizable but have an unmatching executive touch to elevate your office table look.', '2023-05-02 16:51:31', '2023-05-02 16:51:31'),
(19, 48, 'Candle Boxes - Custom CMYK Boxes', 'Pack you candles in an eye-catching way with impeccable custom candle boxes. Their charismatic existence can elevate your product and compel customers to choose it. ', '2023-05-02 16:54:07', '2023-05-02 16:54:07'),
(20, 49, 'Corrugated Boxes - Custom CMYK Boxes', 'Known for their shock-resistant structure, custom corrugated boxes are the best solution to all of your packaging and packing related concerns.', '2023-05-02 16:59:45', '2023-05-02 16:59:45'),
(21, 50, 'Product Boxes - Custom CMYK Boxes', 'No matter what is your product and in which category it falls, you can always get the perfect packaging for any product as custom product boxes are fully customizable.', '2023-05-02 17:02:10', '2023-05-02 17:02:10'),
(22, 51, 'Pyramid Boxes - Custom CMYK Boxes', 'Easy to standout because of their unique shape, custom pyramid boxes are extremely versatile and highly functional to hold any product.', '2023-05-02 17:05:33', '2023-05-02 17:05:33'),
(23, 52, 'Bottle Neckers - Custom CMYK Boxes', 'Available with a variety of embellishments, custom flap boxes are perfect for packing any product of your choice. These boxes with their impressive design can elevate any product to the level of indomitable success.', '2023-05-10 12:07:41', '2023-05-10 12:07:41'),
(24, 53, 'Flap Boxes - Custom CMYK Boxes', 'Custom Flap Boxes have been the center of attraction for years and serving as the most important and commonly used packaging boxes. Custom boxes serve as a strong, reliable packaging box, storage box, and delivery box all in one. Flap boxes are one of the most commonly used cardboard boxes, extended top and bottom Flaps allow these strong packaging boxes to stack on all sides made from rigid corrugated board with a Kraft paper finish, these overlapping flap boxes come with extra-long flaps to provide triple layer protection on the top and on the base. Custom CMYK Boxes has been proved to be the producer of the most unique and alluring printed designs.', '2023-05-10 12:08:08', '2023-05-10 12:08:08'),
(25, 54, 'Shoes Boxes - Custom CMYK Boxes', 'Being one of the most stylish and statement-making products, shoes are one of the most challenging product to pack. With a variety of sizes, shapes and requirements, it becomes quite difficult to cater to every requirement. But custom shoe boxes are perfect for every shoes.', '2023-05-10 12:15:09', '2023-05-10 12:15:09'),
(27, 56, 'Spot UV Boxes - Custom CMYK Boxes', 'Need to put a spotlight to your product amid fully laden market shelves--custom spot UV boxes can do the magic. These boxes have an amazing aura to mesmerize everyone and make your product a center of attraction.', '2023-05-10 12:19:48', '2023-05-10 12:19:48'),
(28, 57, 'Custom Bags - Custom CMYK Boxes', 'The effortless, inexpensive and most effective way of marketing is custom bags. Take your brand to new levels of recognition and success with customized bags.', '2023-05-10 12:26:28', '2023-05-10 12:26:28'),
(29, 58, 'Product Boxes - Custom CMYK Boxes', 'No matter what is your product and in which category it falls, you can always get the perfect packaging for any product as custom product boxes are fully customizable.', '2023-05-10 12:34:18', '2023-05-10 12:34:18'),
(30, 59, 'Cardboard Packaging - Custom CMYK Boxes', 'Fragile or luxury products need extra protection while in transit. Custom Cardboard Packaging provides extra cushioning to make delicate products withstand the pressure of transportation.', '2023-05-10 12:44:49', '2023-05-10 12:44:49'),
(31, 60, 'Pyramid Boxes - Custom CMYK Boxes', 'Easy to standout because of their unique shape, custom pyramid boxes are extremely versatile and highly functional to hold any product.', '2023-05-10 12:45:49', '2023-05-10 12:45:49'),
(32, 61, 'Cube Boxes - Custom CMYK Boxes', 'Perfect to pack any product custom cube boxes are certainly a show stopper. Customize them for any product and see the unlimited options available.', '2023-05-10 12:48:01', '2023-05-10 12:48:01'),
(33, 62, 'Flower Boxes - Custom CMYK Boxes', 'Custom Flower boxes are an eco-friendly packaging option. These boxes are light on your wallet an even lighter on the planet. There are a variety of options to select from.', '2023-05-10 12:53:03', '2023-05-10 12:53:03'),
