(35, 64, 'Gable Boxes - Custom CMYK Boxes', 'Adorable with their handles and origami style structure, custom gable boxes are one of the most stylish and head-turning packaging style. They are ideal to pack any product and are fully customizable.', '2023-05-10 13:15:58', '2023-05-10 13:15:58'),
(36, 65, 'Software Boxes - Custom CMYK Boxes', 'Custom software boxes offer a wide range of customizable packaging options to pack every software product in perfection.', '2023-05-10 13:23:58', '2023-05-10 13:23:58'),
