(39, 68, 'Medicine Boxes - Custom CMYK Boxes', 'No matter whatever type of medicine you deal in, custom medicine boxes are the perfect home to every medicine. They not only protect them during transit, but also with their amazing quality wins the trust of your customers.', '2023-05-10 13:34:32', '2023-05-10 13:34:32'),
