(41, 70, 'Perfume Boxes - Custom CMYK Boxes', 'Custom perfume boxes perfectly protect your fragile perfume cases while turning heads towards them with the iconic branding and impressive graphics. These boxes can be acquired in a variety of designs like rigid, gift, sleeve etc.', '2023-05-10 13:37:38', '2023-05-10 13:37:38'),
