(48, 77, 'Window Boxes - Custom CMYK Boxes', 'When you can\'t impress customers with the printing, give them a peek inside your product with magnificent custom window boxes. These boxes can definitely do wonders for your product by enhancing your product\'s beauty.', '2023-05-10 13:50:16', '2023-05-10 13:50:16'),
(49, 78, 'Bath Bomb Boxes - Custom CMYK Boxes', 'Custom bath bomb boxes with their bespoke appearance are eye-catcher and can surely turn heads. They are all in one solution for your alluring bath bombs.', '2023-05-10 13:53:39', '2023-05-10 13:53:39'),
(50, 79, 'Cosmetic Boxes - Custom CMYK Boxes', 'Have a wide range of cosmetic products and want to pack them uniquely? Don\'t worry, custom cosmetic boxes can perfectly satisfy all the packing needs of your unique cosmetic products.', '2023-05-10 13:55:16', '2023-05-10 13:55:16'),
(52, 81, 'Eye Shadow Boxes - Custom CMYK Boxes', 'No matter the size and shape of your eyeshadow palette, custom eyeshadow boxes embrace every unique curve and shape of your uniquely designed eyeshadow palette.', '2023-05-10 14:01:45', '2023-05-10 14:01:45'),
(53, 82, 'Eyelashes Boxes - Custom CMYK Boxes', 'Delicate products need compatible packaging to stay protected and custom eyelash boxes are exactly what your delicate eyelash product needs. Get a unique packaging design of your choice today!', '2023-05-10 14:07:07', '2023-05-10 14:07:07'),
(54, 83, 'Eyeliner Boxes - Custom CMYK Boxes', 'There are thousands of brands that offer eyeliners of various kinds, what will keep you in the spot light is a unique packaging with promising quality and bombastic printing. Custom eyeliner boxes have everything for product safety and effective marketing.', '2023-05-10 14:09:22', '2023-05-10 14:09:22'),
