(56, 85, 'Hair Extension Boxes - Custom CMYK Boxes', 'Custom Hair Extension Boxes are everything your delicate hair extensions need. They are ideal to pack, protect and deliver hair extensions with their fully customizable features.', '2023-05-10 14:14:18', '2023-05-10 14:14:18'),
