(58, 87, 'Lip Balm Boxes - Custom CMYK Boxes', 'Transform your product with these custom lip balm boxes that boast unbelievably realistic prints and a high-quality structure.', '2023-05-10 14:17:02', '2023-05-10 14:17:02'),
