(60, 89, 'Tea Boxes - Custom CMYK Boxes', 'Have a unique blend but don\'t know how to spread the word about the uniqueness of your tea, custom tea boxes can do wonders. With their spectacular perfection in every aspect they can take your product to the new levels of success. ', '2023-05-10 14:25:25', '2023-05-10 14:25:25'),
(61, 90, 'Lotion Boxes - Custom CMYK Boxes', 'Custom lotion boxes have every quality your lotion product want to make its place in the super abundant market.', '2023-05-10 14:25:55', '2023-05-10 14:25:55'),
