(63, 92, 'Makeup Boxes - Custom CMYK Boxes', 'Best way to manage your makeup products is by packing them in custom makeup boxes. These boxes are easy to use and keeps all your expensive make up products safe and at one place.', '2023-05-10 14:28:40', '2023-05-10 14:28:40'),
(64, 93, 'Mascara Boxes - Custom CMYK Boxes', 'Cosmetic industry is overly abundant with incredible amount of brands in the game. If you want to make your brand stand out, consider packaging your mascara in custom boxes.', '2023-05-10 14:30:23', '2023-05-10 14:30:23'),
(65, 94, 'Snack Boxes - Custom CMYK Boxes', 'Its hard to cater to every requirement of the product. But if your packaging is not perfect it is unimpressive. Pack every snack in a unique way yet perfectly in Custom snack boxes.', '2023-05-10 14:32:25', '2023-05-10 14:32:25'),
