(67, 96, 'Bakery Boxes - Custom CMYK Boxes', 'Your packaging must be as good as your delicious bakery products are. Custom bakery boxes allow to you perfectly nestle your delicate and delicious bakery items together with a boastful branding.', '2023-05-10 14:35:54', '2023-05-10 14:35:54'),
