(69, 98, 'Bottle Boxes - Custom CMYK Boxes', 'Custom bottle boxes-where safety, perfection, precision and excellence comes together. These boxes are a perfect fit to pack, protect and present your bottles in your unique and special style.', '2023-05-10 14:37:48', '2023-05-10 14:37:48'),
(70, 99, 'Cake Boxes - Custom CMYK Boxes', 'Cake boxes come in a variety of shapes and sizes. They can be used to store and transport cakes, and can also be used as presentation boxes. Custom cake boxes provide a great way to preserve cakes, keeping them fresh and delicious for longer. ', '2023-05-10 14:41:38', '2023-05-10 14:41:38'),
(71, 100, 'Pie Boxes - Custom CMYK Boxes', 'Ideal and best quality custom pie boxes can effectively market your brand name as well. If your delicious pies are unable to catch the spot light, pack them in custom boxes and they will surely turn maximum heads.', '2023-05-10 14:44:22', '2023-05-10 14:44:22'),
(72, 101, 'Display Boxes - Custom CMYK Boxes', 'Ensure the perfect display of your product while making the most impressive image of your brand with custom display boxes. Get the perfect and highly functional boxes of your choice today.\r\n\r\n\r\n', '2023-05-10 14:50:33', '2023-05-10 14:50:33'),
(73, 102, 'Pastry Boxes - Custom CMYK Boxes', 'Pastries of any kind and every kind can be perfectly packed and delivered in these custom pastry boxes. they are fully customizable so you can get them curated in any size and shape of your need.', '2023-05-10 14:52:30', '2023-05-10 14:52:30'),
(74, 103, 'Macaron Boxes - Custom CMYK Boxes', 'As cute as your macarons are they deserve a packaging equally exquisite. Custom macaron boxes gives your macarons an identity they need.', '2023-05-10 14:56:23', '2023-05-10 14:56:23'),
(75, 104, 'Candy Boxes - Custom CMYK Boxes', 'Impress young customers with enchanting custom candy boxes. These boxes have eye-catching graphics and impressive designs to catch customer\'s eyes.', '2023-05-10 14:58:00', '2023-05-10 14:58:00'),
(76, 105, 'Cereal Boxes - Custom CMYK Boxes', 'When it is about preserving what is good, there is no match for non-toxic and eco-friendly custom cereal boxes. These boxes have capability to retain the freshness of your cereal with their perfect structure.', '2023-05-10 14:59:42', '2023-05-10 14:59:42'),
(77, 106, 'Food Boxes - Custom CMYK Boxes', 'Want to pack a diverse range of your food items without compromising on the main theme and style of your branding? Custom food boxes are exactly what you need to pack all your edible goods differently, yet without compromising your brand persona.', '2023-05-10 15:00:21', '2023-05-10 15:00:21'),
(78, 107, 'Chines Takeout Boxes - Custom CMYK Boxes', 'Custom Chinese Takeout Boxes have a non-toxic structure with interior lamination, making them durable for packing and perfectly delivering any Chinese cuisine.', '2023-05-10 15:00:48', '2023-05-10 15:00:48'),
(79, 108, 'Chocolate Boxes - Custom CMYK Boxes', 'Whether for retail packaging or special occasions, custom chocolate boxes are everything you need to offer to your chocolates.', '2023-05-10 15:03:36', '2023-05-10 15:03:36'),
(80, 109, 'Coffee Boxes - Custom CMYK Boxes', 'Preserve the heavenly aroma and quality of your freshly roasted coffee by giving it a packaging that is worth it. Custom coffee boxes have customized features to offer promising care.', '2023-05-10 16:26:41', '2023-05-10 16:26:41'),
(81, 110, 'Cookies Boxes - Custom CMYK Boxes', 'Obviously, not every cookie is the same. So pack your cookies in custom cookie boxes that are specially designed according to your cookie requirements.', '2023-05-10 16:31:03', '2023-05-10 16:31:03'),
(82, 111, 'Cupcake Boxes - Custom CMYK Boxes\"', 'Impress your customers with highly affordable yet high-end custom cupcake boxes. Their pocket friendly feature makes it easy for you to impress your customers with a new packaging design for every order.', '2023-05-10 16:34:34', '2023-05-10 16:34:34'),
(83, 112, 'Donut Boxes - Custom CMYK Boxes', 'Custom Donut Boxes are available in various sizes and shapes to serve various requirements. These boxes are also ideal for making deliveries at special events.', '2023-05-10 16:46:57', '2023-05-10 16:46:57'),
(84, 113, 'Perfect Custom Lipstick Boxes for Bespoke Presentation', 'Our Custom Lipstick Boxes prove to be the best packaging solution for increasing your product\'s functionality, marketability, and productivity.', '2023-11-27 23:31:46', '2023-11-27 23:31:46'),
